import React from 'react'

const BackButton = ({ type }) => {
    return (
      <TouchableOpacity style={styles.iconbutton}>
        <Image source="fa-sharp fa-solid fa-arrow-left"/>
      </TouchableOpacity>
    );
  };

const styles = StyleSheet.create({
    iconbutton: {
      margin: 10,
    },
});
  
export default BackButton;
